.el-divider--horizontal {
  	margin: 0;
}
// 父窗口的类
.container {
	text-align: left;

	.title {
		height: 59px;
		line-height: 59px;
		color: $parent-title-color;
		font-size: 16px;
		font-weight: 500;
		text-indent: 40px;

		.back {
			float: right;
			margin-right: 40px;
			cursor: pointer;
		}
  }

  .wrap {
    padding: 20px;

	.hr-name {
		margin-left: 40px;
		margin-right: 10px;
	}
	.hr-img {
		display: inline-block;
		width: 32px;
		height: 32px;
		position: absolute;
		left: 0;
	}
  }

  .submit {
    float: left;
  }
}

@media screen and (max-width :1000px){
	.mapUI-describe {
		width: 250px;
	}
}
.mapUI {
	overflow: hidden;
	z-index: 9999;
	.mapUI-describe {
		background: #0000005e;
		color: white !important;
		padding: 5px;
		position: absolute;
		top: 0;
		right: 0;
		border-radius: 5px;
		border-top-left-radius: 0;
		border-bottom-right-radius: 0;
		transition: rgba,width .5s;
		&:hover {
			background: rgba(0, 0, 0, 0.7);
		}

		>div {
			margin-bottom: 20px;
			>span {
				display: inline-block;
			}
			>span:nth-child(1){
				width: 30%;
				text-align: left;
			}
			>span:nth-child(2){
				width: 70%;
				text-align: right;
				// color: black;
			}
		}
		.searchList {
			border: 1px solid black;
			height: 200px;
			overflow: auto;

			div {
				margin: 10px 0;
				padding: 10px 0;
				text-align: center;
				color: black;
				font-size: 16px;
			}
			div:hover {
				background-color: #0000002b;
			}
			div::-webkit-scrollbar {
				width: 2px !important;
			}
		}
	}
	.el-dialog {
		margin-top: 10vh !important;
		width: 80% !important;
		font-size: 25px;
	}
	::v-deep .el-dialog__header {
		display: none;
	}
}

.login-msg >div{
	padding: 0 !important;
	transition: all .5s;
	&:hover{
		color: #454641;
		background: none;
		// border: 1px solid #aaffaa;
	}
}
.group-not{
	color: crimson !important;
	cursor: pointer;
	pointer-events: none;
	user-select: none;
}
